INSERT INTO `haberler` (`ID`, `baslik`, `icerik`, `resim`, `ekleyen`, `tarih`, `seo`, `etiket`) VALUES
(1, 'Reel efektif döviz kuru endeksi aralıkta geriledi', '<p>T&uuml;rkiye Cumhuriyet Merkez Bankası (TCMB) tarafından yayımlanan ge&ccedil;ici &nbsp;verilere g&ouml;re, 2003=100 bazlı reel efektif d&ouml;viz kuru endeksi, T&Uuml;FE bazında 2019 &nbsp;yılının aralık ayında bir &ouml;nceki aya kıyasla 1,20 puan azalışla 76,17&#39;ye indi. &nbsp;Endeks, kasım ayında 77,37 d&uuml;zeyinde bulunuyordu.</p>\r\n\r\n<p>Yİ-&Uuml;FE bazında reel efektif d&ouml;viz kuru endeksi, aynı d&ouml;nemde 2,19 puan &nbsp;azalarak 82,07&#39;den 79,88&#39;e geriledi.</p>\r\n\r\n<p>T&uuml;rk lirasının değeri, 2019&#39;un aralık ayında bir &ouml;nceki yılın aynı &nbsp;ayına g&ouml;re T&Uuml;FE bazında 0,20 puan, Yİ-&Uuml;FE bazında ise 2,87 puan azaldı.</p>\r\n', 'haberresim_1578318907.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'reel-efektif-doviz-kuru-endeksi-aralikta-geriledi', 'Reel, efektif, döviz'),
(2, 'Türkiye 2019 Akaryakıttan Ne Kadar Feragat Etti', '<p>Benzin ve motorin fiyatlarına tavan uygulaması olarak 2018 yılında getirilen Eşel Mobil Sistemi`nin 2019 yılındaki maliyeti belli oldu. EPGİS`ten Uzmanpara`ya yapılan a&ccedil;ıklamaya g&ouml;re; 2019 yılında devlet akaryakıttan 1.762.069.428 TL feragat etti. Eşel Mobil Sistemi 2019 yılında motorin, benzin ve LPG`de toplam 12 kez devreye alındı.</p>\r\n\r\n<p>T&uuml;rkiye&#39;deki ara&ccedil; sahipleri 2018 yılının mayıs ayından bu yana akaryakıtta Eşel Mobil Sistemi&#39;ni kullanıyor. Bu uygulamaya g&ouml;re akaryakıt fiyatları &ccedil;ok fazla arttığı d&ouml;nemlerde belli tutarın &uuml;zerindeki zamlar devlet tarafından karşılanıyor. Peki 2019 yılında devlet &Ouml;TV&#39;den ne kadar feragat etti? EPGİS&#39;ten Uzmanpara&#39;ya yapılan a&ccedil;ıklamaya g&ouml;re; devlet 2019 yılında motorinde 1.473.434.791 TL, benzinde 124.180.820 TL, LPG&#39;de ise 164.453.815 TL feragat etti.&nbsp;</p>\r\n\r\n<p>2019 yılında Eşel Mobil Sistemi&#39;nin t&uuml;m akaryakıt gruplarında 12 kez devreye alındığını s&ouml;yleyen Enerji Petrol Gaz İkmal İstasyonları İşveren Sendikası (EPGİS) Başkanı Fesih Aktaş yaptığı a&ccedil;ıklamada, &quot;2019 yılında Eşel Mobil Sistemi, motorin i&ccedil;in 6, benzin i&ccedil;in 4, LPG otogaz i&ccedil;in ise 2 defa devreye alındı.&quot; dedi.</p>\r\n\r\n<p>2018 yılına g&ouml;re &Ouml;TV tutarının yaklaşık 6.7 milyar TL azaldığını belirten Aktaş, &quot;2019 yılında dolar ve &uuml;r&uuml;n fiyatları ge&ccedil;en yıla g&ouml;re daha alt seviyelerde işlem g&ouml;rd&uuml;ğ&uuml;nden &Ouml;TV&#39;den feragat etme s&uuml;releri kesintili ve kısa s&uuml;reli oldu, bu y&uuml;zden toplam rakam d&uuml;ş&uuml;k kaldı.&quot; ifadelerini kullandı.</p>\r\n', 'haberresim_1578319740.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'turkiye-2019-akaryakittan-ne-kadar-feragat-etti', 'akaryakıt, feregat, benzin, mazot'),
(3, 'Piyasa hacmi 200 milyar doların üzerinde', '<p>ABD ve İran arasındaki gerilimlerle Orta Doğu`daki jeopolitik karışıklığın y&uuml;kselmesinin, yatırımcıları g&uuml;venli liman varlıklarına y&ouml;nlendirmesiyle kripto para birimleri piyasa hacmi 202 milyar 295 milyon dolarla 10 Aralık 2019`dan bu yana ilk kez 200 milyar doların &uuml;zerinde seyrediyor.</p>\r\n\r\n<p>DHA</p>\r\n\r\n<p>ABD ordusunun ge&ccedil;en hafta Başkan Donald Trump&#39;ın emriyle İran&#39;ın &ouml;nde gelen askeri yetkililerinden General Kasım S&uuml;leymani&#39;yi &ouml;ld&uuml;rmesi iki &uuml;lke arasındaki hassas ilişkinin daha da gerilmesine yol a&ccedil;mıştı. İran&#39;ın S&uuml;leymani cinayetinin intikamı alınacağı a&ccedil;ıklaması sonrası 2015 n&uuml;kleer anlaşması y&uuml;k&uuml;ml&uuml;l&uuml;klerini yerine getirmeyeceği ve ABD&#39;nin Orta Doğu&#39;daki g&uuml;&ccedil;lerine saldırma tehdidinin yanında, Trump da İran&#39;ın misilleme karşılık vermesi durumunda daha sert &ouml;nlemler alınacağını a&ccedil;ıklaması, k&uuml;resel hisse senedi piyasalarındaki d&uuml;ş&uuml;ş eğilimini korumuş, altın fiyatı ise 1579.10 dolarla son yedi yılın en y&uuml;ksek d&uuml;zeyini g&ouml;rm&uuml;şt&uuml;.</p>\r\n\r\n<p>S&ouml;z konusu jeopolitik karışıklık kripto para birimleri piyasalarına da olumlu yansırken, yatırımcı &ouml;zg&uuml;veni ayrıca &Ccedil;in Merkez Bankası&#39;nın kendi kripto para birimine y&ouml;nelik olumlu a&ccedil;ıklamalarıyla desteklendi. PBoC a&ccedil;ıklamasında, bankanın kendi kripto para birimi &ccedil;alışmalarının p&uuml;r&uuml;zs&uuml;zce devam ettiği belirtildi ve &quot;2020&#39;de yasal dijital para birimlerinin gelişimine y&ouml;nelik &ccedil;alışmaları dengeli bir şekilde s&uuml;rd&uuml;receğiz&quot; denildi.</p>\r\n\r\n<p>Gelişmelerin ardından kripto para birimleri piyasasının belirleyicisi Bitcoin, son 24 saatte y&uuml;zde 1.01 artışla 7,565 dolara y&uuml;kseldi ve 137 milyar 267 milyon dolarlık piyasa hacmiyle piyasanın y&uuml;zde 67.9&#39;unu oluşturdu.</p>\r\n\r\n<p>Toplam 5,002 adet kripto para biriminin oluşturduğu piyasanın en y&uuml;ksek hacimli 100 biriminden son 24 saatte 73&#39;&uuml; y&uuml;kselirken, piyasadaki artışa y&uuml;zde 16.13 ile 79&#39;uncu sıradaki MaidSafeCoin &ouml;nc&uuml;l&uuml;k etti. En b&uuml;y&uuml;k 10&#39;dan da son 24 saatte y&uuml;zde 0.33 ile yalnızca Tether d&uuml;şerken, y&uuml;zde 8.27 artış ile de Monero, Stelları geride bırakarak 10&#39;uncu sıraya y&uuml;kseldi.</p>\r\n\r\n<p>Piyasadaki s&ouml;z konusu g&ouml;r&uuml;n&uuml;me paralel olarak piyasa hacmi son 24 saatte y&uuml;zde 2.0 artışla 202 milyar 419 milyon dolara y&uuml;kselerek 10 Aralık 2019&#39;dan bu yana ilk kez 200 milyar doların &uuml;zerinde işlem g&ouml;rd&uuml;. Piyasadaki 24 saatlik işlem hacmi de 70 milyar 425 milyon dolar olarak hesaplandı.</p>\r\n\r\n<p>En y&uuml;ksek hacimli 10 kripto para birimindeki değişiklikler (sıra numaraları, birimlerin sıralamadaki yerini g&ouml;steriyor);</p>\r\n\r\n<p>1.Bitcoin y&uuml;ze 1.01</p>\r\n\r\n<p>2.Ethereum y&uuml;zde 3.20</p>\r\n\r\n<p>3.Ripple y&uuml;zde 3.05</p>\r\n\r\n<p>4.Bitcoin Cash y&uuml;zde 5.91</p>\r\n\r\n<p>6.Litecoin y&uuml;zde 4.32</p>\r\n\r\n<p>7.EOS y&uuml;zde 2.90</p>\r\n\r\n<p>8.Binance Coin y&uuml;zde 2.45</p>\r\n\r\n<p>9.Bitcoin SV y&uuml;zde 6.37</p>\r\n\r\n<p>10.Monero y&uuml;zde 8.27 y&uuml;kseldi.</p>\r\n', 'haberresim_1578319861.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'piyasa-hacmi-200-milyar-dolarin-uzerinde', 'bitcoin, sanal, para'),
(4, 'Petrol tedariki için S. Arabistan ile birlikte çalışacağız', '<p>Birleşik Arap Emirlikleri Enerji Bakanı Suhail al-Mazroui, petrol piyasalarındaki g&ouml;r&uuml;lebilecek olası dengesizliğin &ouml;nlenmesi ve k&uuml;resel petrol piyasalarında mevcut tedarikin s&uuml;rd&uuml;r&uuml;lmesi i&ccedil;in Suudi Arabistan ile birlikte &ccedil;alışacaklarını s&ouml;yledi.</p>\r\n\r\n<p>Birleşik Arap Emirlikleri (BAE) Enerji Bakanı Suhail al-Mazroui&#39;nin a&ccedil;ıklamaları, Orta Doğu&#39;da ABD ve İran &ccedil;atışması sebebiyle y&uuml;kselen gerilimlerin ardından Birleşik Krallık ve Japonya&#39;nın Basra K&ouml;rfezi&#39;ndeki ticari gemilerin korunması i&ccedil;in ordularını g&ouml;revlendirmeye hazır oldukları a&ccedil;ıklaması sonrası yapıldı.</p>\r\n\r\n<p>Bunun yanında, Saudi Aramco hisseleri Pazartesi g&uuml;n&uuml; y&uuml;zde 0.43 d&uuml;ş&uuml;şle 34.40 riyale (9.17 dolar) gerileyerek, Aralık ayındaki halka arzından bu yana g&ouml;r&uuml;len en d&uuml;ş&uuml;k d&uuml;zeyini g&ouml;rd&uuml;.</p>\r\n\r\n<p>Gelişmelere paralel olarak petrol piyasalarında Brent ham petrol&uuml; varil başına y&uuml;zde 1.92 artışla 69.94 dolara, ABD hafif petrol&uuml; de y&uuml;zde 1.65 artışla 64.09 dolara y&uuml;kseldi.</p>\r\n', 'haberresim_1578319946.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'petrol-tedariki-icin-s-arabistan-ile-birlikte-calisacagiz', 'petrol, tedarik, sudi arabistan'),
(6, 'Para politikalarında İran gerilimleri göz önüne alınacak', '<p>Japonya Merkez Bankası (BoJ) Başkanı Haruhiko Kuroda, ticari bankaların &#39;Yeni Yıl&#39; toplantısında yaptığı konuşmada, &quot;ABD-&Ccedil;in ticari gerilimleri ve jeopolitik riskler, gelecekte ilişkilerin nasıl ilerleyeceğini &ouml;ng&ouml;remeyeceğimiz bir noktaya geldi&quot; dedi.</p>\r\n\r\n<p>ABD ve İran arasındaki gerilimler, ABD ordusunun Başkan Donald Trump&#39;ın emriyle İran&#39;ın &ouml;nde gelen askeri yetkililerinden General Kasım S&uuml;leymani&#39;yi &ouml;ld&uuml;rmesi ve Tahran&#39;ın 2015 n&uuml;kleer anlaşmasından &ccedil;ekileceği a&ccedil;ıklaması ile Orta Doğu&#39;daki ABD g&uuml;&ccedil;lerine saldırma tehdidiyle y&uuml;kselmişti.</p>\r\n\r\n<p>Bunun &ouml;ncesinde Trump, &Ccedil;in ile varılan ticaret anlaşmasının ilk kısmının 15 Ocak&#39;ta Beyaz Saray&#39;da imzalanacağını ve anlaşmanın ikinci kısmına y&ouml;nelik m&uuml;zakerelerin kısa s&uuml;re i&ccedil;inde başlayacağını duyurmuştu.</p>\r\n', 'haberresim_1578320098.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'para-politikalarinda-iran-gerilimleri-goz-onune-alinacak', 'para, politikası'),
(7, '2020`de kredi büyümesi ivme kazanacak', '<p>TSKB Genel M&uuml;d&uuml;r&uuml; Suat İnce, &quot;Bankacılık S&ouml;yleşileri&quot; kapsamında AA muhabirine, &nbsp;bankacılık sekt&ouml;r&uuml;, T&uuml;rkiye ekonomisi ve TSKB&#39;nin performansına ilişkin &nbsp;değerlendirmelerde bulundu.</p>\r\n\r\n<p>Bankacılık sekt&ouml;r&uuml;n&uuml;n &ouml;zellikle 2019&#39;un ikinci yarısında canlanan &nbsp;kredi talebiyle birlikte kasım sonu itibarıyla kredilerini kur etkisinden &nbsp;arındırılmış olarak yaklaşık y&uuml;zde 6 arttırdığını belirten İnce, Merkez &nbsp;Bankasının faiz indirimleri ve kamu otoritelerinin aldıkları zamanlı &ouml;nlemlerin &nbsp;ekonomik beklentilerin olumlu y&ouml;nde gelişmesini sağlamasıyla 2020 yılında da hem &nbsp;iş d&uuml;nyasının hem de t&uuml;keticilerin kredi talebinde artışın devam edeceğini ve &nbsp;sekt&ouml;r bazında kredi b&uuml;y&uuml;mesinin ivme kazanacağını &ouml;ng&ouml;rd&uuml;klerini s&ouml;yledi.</p>\r\n\r\n<p>İnce, bankacılık sekt&ouml;r&uuml;n&uuml;n 2020&#39;de de kaynaklarını en uygun şekilde &nbsp;artırarak, &uuml;lke ekonomisine katkı sağlamayı s&uuml;rd&uuml;receğini ifade etti.</p>\r\n\r\n<p>&quot;T&Uuml;RK EKONOMİSİNİN 2020&#39;DE ILIMLI B&Uuml;Y&Uuml;YECEK&quot;</p>\r\n\r\n<p>Suat İnce, 2019&#39;de hem TSKB&#39;nin hem de diğer kurumların gerek uluslararası finans kuruluşlarından gerekse kalkınma finansmanı kurumlarından &nbsp;kaynak temin etmeye devam ettiğini s&ouml;yledi.</p>\r\n\r\n<p>Bankaların 2019&#39;da yabancı para kredi talebine mukayeseli TL kredi &nbsp;tarafında daha fazla iştah olmasıyla yabancı para bor&ccedil;lanmalarını kendi &nbsp;tercihleri ile azalttıklarına işaret eden İnce, &ouml;rneğin sendikasyon kredilerini &nbsp;gelen taleplere rağmen 100&#39;&uuml;n altında bir yenileme oranı ile ger&ccedil;ekleştirmeyi &nbsp;tercih ettiklerini dile getirdi.</p>\r\n\r\n<p>İnce, buna ilaveten, bir&ccedil;ok bankanın itfa tarihinde yeni bir eurobond &nbsp;ihracı ger&ccedil;ekleştirmeden rahatlıkla tahvillerinin itfasını ger&ccedil;ekleştirdiklerini &nbsp;ifade etti.</p>\r\n\r\n<p>2020 yılında T&uuml;rk ekonomisinin ılımlı bir b&uuml;y&uuml;me kaydedeceğini tahmin &nbsp;eden İnce, T&uuml;rk bankacılık sekt&ouml;r&uuml;n&uuml;n sağlamlığını g&ouml;z &ouml;n&uuml;nde bulundurarak &nbsp;sekt&ouml;r&uuml;n rahatlıkla gerek yurt i&ccedil;i gerekse yurt dışından yeterli seviyelerde &nbsp;kaynak temin etmeye devam edeceğini s&ouml;yledi.</p>\r\n\r\n<p>İnce, bu doğrultuda, bankacılık sekt&ouml;r&uuml;n&uuml;n ekonomik kalkınma i&ccedil;in &nbsp;etkin şekilde &ccedil;alışma odağını s&uuml;rd&uuml;receğini kaydetti.</p>\r\n\r\n<p>FAİZ İNDİRİMİ BEKLENTİSİ</p>\r\n\r\n<p>TSKB Genel M&uuml;d&uuml;r&uuml; İnce, TCMB&#39;nin 12 Aralık&#39;taki PPK toplantısında &nbsp;beklentiler dahilinde indirime devam ederken, gelecek d&ouml;nemde a&ccedil;ıklanacak &nbsp;verilere bağlı olarak indirimlere devam edebileceğinin sinyalini verdiğini &nbsp;anlattı.</p>\r\n\r\n<p>Bu kapsamda, Merkez Bankasının, k&uuml;resel koşulların desteği ile faiz &nbsp;indirimlerine daha yavaş adımlarla da olsa devam edilebileceğini &ouml;ng&ouml;rd&uuml;klerini &nbsp;s&ouml;yleyen İnce, &quot;İndirimlerin hızının ise b&uuml;y&uuml;k &ouml;l&ccedil;&uuml;de enflasyondaki iyileşmeye ve &nbsp;finansal istikrara ilişkin &ouml;nc&uuml; verilere bağlı olacağını d&uuml;ş&uuml;n&uuml;yoruz.&quot; dedi.</p>\r\n\r\n<p>&quot;TAKİPTEKİ ALACAKLARDA AZALIŞ TRENDİ BAŞLAYACAK&quot;</p>\r\n\r\n<p>Suat İnce, T&uuml;rkiye ekonomisinin, 2020 yılında net dış talebin b&uuml;y&uuml;meyi &nbsp;sınırlayabilecek olmasından dolayı, y&uuml;zde 4&#39;l&uuml;k b&uuml;y&uuml;me temposunu &nbsp;yakalayabileceğini s&ouml;yledi.</p>\r\n\r\n<p>Buna bağlı olarak cari işlemler hesabında milli gelirin y&uuml;zde 2&#39;si &nbsp;civarında bir a&ccedil;ık olabileceğini beklediklerini ifade eden İnce, &quot;2020&#39;de &nbsp;TCMB&#39;nin faizlerde bir miktar daha indirim i&ccedil;in yeri olduğunu değerlendirirken, &nbsp;bu durumun bankacılık sekt&ouml;r&uuml;nde net faiz marjı ve toplam karlılığı &uuml;zerindeki &nbsp;olumlu etkisinin s&uuml;rebileceğini değerlendiriyoruz.&quot; şeklinde konuştu.</p>\r\n\r\n<p>İnce, b&uuml;y&uuml;menin toparlanması ve yeniden yapılandırma s&uuml;reciyle &nbsp;sekt&ouml;r&uuml;n aktif kalitesindeki bozulmanın duracağını ve 2020&#39;nin ikinci yarısıyla &nbsp;takipteki alacaklarda azalış trendinin başlayabileceğini tahmin ettiklerini dile &nbsp;getirdi.</p>\r\n\r\n<p>&quot;YABANCI YATIRIMCILARIN EN YETKİN LOKAL İŞ ORTAĞI OLMAYI HEDEFLİYORUZ&quot;</p>\r\n\r\n<p>TSKB Genel M&uuml;d&uuml;r&uuml; İnce, banka olarak 2019 yılında &ouml;zel sekt&ouml;re &nbsp;s&uuml;rd&uuml;r&uuml;lebilirlik ve kapsayıcılık temalı krediler sağlamaya devam ettiklerini &nbsp;anlattı.</p>\r\n\r\n<p>Yeni kullandırımlarda ağırlıklı olarak yenilenebilir enerji, kadın &nbsp;istihdamı, fırsat eşitliği, end&uuml;striyel gelişim, KOBİ finansmanı ve kaynak &nbsp;verimliliği yatırımlarının &ouml;ne &ccedil;ıktığını belirten İnce, Avrupa İmar ve Kalkınma &nbsp;Bankası&rsquo;nın (EBRD) T&uuml;rkiye&#39;de sadece TSKB ile imzaladığı risk paylaşımı iş &nbsp;birliği ile &ouml;zel sekt&ouml;re yatırım ve işletme kredisi olarak EBRD ile birlikte &nbsp;toplamda 100 milyon avro tutarına kadar kaynak sağlamak &uuml;zere yola &ccedil;ıktıklarını &nbsp;dile getirdi.</p>\r\n\r\n<p>İnce, &Ccedil;in Kalkınma Bankası ile 200 milyon dolar tutarında yeni kaynak &nbsp;anlaşması imzaladık ifade etti.</p>\r\n\r\n<p>&Ccedil;in Kalkınma Bankasının, Hazine ve Maliye Bakanlığı garantisi altında T&uuml;rkiye&#39;de bir bankaya sağladığı ilk ve en uzun vadeli kredi olma &ouml;zelliğini &nbsp;taşıyan bu finansmanlagelecek d&ouml;nemde &uuml;lkedeki &uuml;retim, sanayi, KOBİ, enerji, &nbsp;altyapı, sağlık ve eğitim projelerini destekleyeceklerini s&ouml;yleyen İnce, şunları &nbsp;kaydetti:</p>\r\n\r\n<p>&quot;Kasım ayında ise Fransız Kalkınma Ajansı ile 85 milyon avro tutarında &nbsp;yeni bir kredi anlaşması imzaladık. 2016 yılında imzalanan kadın istihdamı ve iş &nbsp;sağlığı g&uuml;venliği kredisinin devamı niteliğinde olan bu kredimizle, T&uuml;rkiye&#39;deki &nbsp;&ccedil;alışma ortamında cinsiyet eşitliğini dikkate alan ve kadın istihdamına fırsat &nbsp;tanıyan firmaların yapacağı yatırımlara kaynak sağlayacağız. 2019 yılındaki diğer &nbsp;&ouml;nemli odak alanlarımız da danışmanlık ve yatırım bankacılığı hizmetlerimizdi. TSKB olarak uzun yıllardır sahip olduğumuz g&uuml;&ccedil;l&uuml; ekonomist, finansal analist ve &nbsp;m&uuml;hendislik ekiplerimizle &uuml;lke kalkınmasına finansman dışı yetkinliklerimizle de &nbsp;katkı sağlamaktaydık. Bu katkımızı daha yapılandırılmış bir şekilde sunmak &nbsp;amacıyla 2019 yılında entegre danışmanlık hizmeti modelini kurduk.</p>\r\n\r\n<p>Bu modelin ana odağı T&uuml;rkiye&#39;nin lokomotif sekt&ouml;rlerinde faaliyet &nbsp;g&ouml;steren firmalara d&ouml;n&uuml;ş&uuml;m, gelişim ve s&uuml;rd&uuml;r&uuml;lebilirlik yolculuklarında &nbsp;rehberlik etmek. &Uuml;lkemizde yatırım planlayan global şirketlere ve fonlara y&ouml;nelik &nbsp;hizmetlerimizle de yabancı yatırımcıların en yetkin lokal iş ortağı olmayı &nbsp;hedefliyoruz. TSKB olarak &uuml;lkemiz kalkınmasındaki katkımızı sermaye piyasaları, &nbsp;gayrimenkul değerleme ve s&uuml;rd&uuml;r&uuml;lebilirlik danışmanlığı alanlarında &ouml;nemli &nbsp;başarılara imza atan iştiraklerimizle bir adım &ouml;teye taşıdığımızı s&ouml;ylemek &nbsp;isterim. Yatırım Finansman Menkul Değerler, TSKB Gayrimenkul Değerleme ve &nbsp;Escarus&#39;un getirdiği &ouml;zel uzmanlık alanlarıyla m&uuml;şterilerimize sunduğumuz &nbsp;&ccedil;&ouml;z&uuml;mleri &ccedil;eşitlendirme ve derinleştirme imkanı buluyoruz.&quot;</p>\r\n\r\n<p>&quot;FİNANS SEKT&Ouml;R&Uuml;NDE AYRIŞAN BİR KURUMUZ&quot;</p>\r\n\r\n<p>Suat İnce, TSKB olarak 70. faaliyet yılına doğru ilerlerken &nbsp;T&uuml;rkiye&#39;nin kalkınmasına ve s&uuml;rd&uuml;r&uuml;lebilir b&uuml;y&uuml;mesine &ccedil;ok y&ouml;nl&uuml; katkıya devam &nbsp;ettiklerini belirtti.</p>\r\n\r\n<p>TSKB olarak kalkınma finansmanı, yatırım bankacılığı ve danışmanlık &nbsp;alanlarında değer yarattıklarını ifade eden İnce, uluslararası finans &nbsp;kurumlarından sağladıkları ve farklı temalar etrafında &ccedil;eşitlenen fonları T&uuml;rk &nbsp;&ouml;zel sekt&ouml;r yatırımlarına aktardıklarını anlattı.</p>\r\n\r\n<p>İnce, TSKB olarak y&uuml;zde 73 oranında s&uuml;rd&uuml;r&uuml;lebilir ve kapsayıcı &nbsp;yatırımlardan oluşan kredi portf&ouml;y&uuml; ile finans sekt&ouml;r&uuml;nde ayrışan bir kurum &nbsp;olduklarını bildirdi.</p>\r\n\r\n<p>İklim değişikliği, enerji ve kaynak verimliliği, &ccedil;evre, kadın istihdamı gibi &ccedil;evresel ve sosyal yatırımların 2020 yılında da odak alanları olmaya devam edeceğini s&ouml;yleyen İnce, &quot;&Ouml;zel sekt&ouml;r&uuml;n bu y&ouml;ndeki yatırımlarını desteklemek &uuml;zere finansman kaynaklarımızı &ccedil;eşitlendirerek artırmayı &nbsp;hedefliyoruz. 2020 yılı kredilendirme faaliyetlerimizde s&uuml;rd&uuml;r&uuml;lebilir ve &nbsp;kapsayıcı yatırımlara d&ouml;n&uuml;k konsantrasyonumuzu s&uuml;rd&uuml;rd&uuml;ğ&uuml;m&uuml;z ve &uuml;lkemizin &nbsp;kalkınma yolculuğuna danışmanlık ve yatırım bankacılığı hizmetlerimizle artan &nbsp;oranda katkı verme iddiasında olduğumuz bir yıl olacak.&quot; diyerek s&ouml;zlerini &nbsp;tamamladı.</p>\r\n', 'haberresim_1578320155.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', '2020de-kredi-buyumesi-ivme-kazanacak', '2020, kredi, büyüme, kazanacak'),
(8, 'Yaş meyve ve sebze ihracatı 2 milyar 260 milyon dolara ulaştı', '<p>Akdeniz Yaş Meyve Sebze İhracat&ccedil;ıları Birliği Y&ouml;netim &nbsp;Kurulu Başkanı Nejdat Sin, yazılı a&ccedil;ıklamasında, yaş meyve ve sebze sekt&ouml;r&uuml;n&uuml;n, ihracatıyla &nbsp;milli ekonomiye net d&ouml;viz girdisi sağladığını belirterek, yıllık narenciye &nbsp;ihracatının 755,7 milyon dolar, taze meyve ihracatının 845,46 milyon dolar, taze &nbsp;sebze ihracatının 644,16 milyon dolar, &ccedil;ay ihracatının da yaklaşık 15 milyon &nbsp;dolar gelir getirdiğini vurguladı.</p>\r\n\r\n<p><strong>En fazla ihracat Rusya&#39;ya yapıldı</strong></p>\r\n\r\n<p>En &ccedil;ok ihra&ccedil; edilen &uuml;r&uuml;n&uuml;n mandarin olduğunu aktaran Sin, &quot;&Uuml;lke olarak &nbsp;2019&rsquo;da 758 bin 160 ton mandarin ihra&ccedil; edip, 347,33 milyon dolar d&ouml;viz kazandık. &nbsp;En &ccedil;ok ihra&ccedil; ettiğimiz ikinci &uuml;r&uuml;n ise 304,5 milyon dolar ile domates oldu. &nbsp;Limon, 244,8 milyon dolar ile &uuml;&ccedil;&uuml;nc&uuml; sırada yer aldı.&quot; ifadesini kullandı.</p>\r\n\r\n<p>Sin, en &ccedil;ok ihracatın Rusya&#39;ya yapıldığına belirterek, bu &uuml;lkeye &nbsp;yapılan satışların y&uuml;zde 13 artarak 746,3 milyon dolara ulaştığını ifade etti.</p>\r\n\r\n<p>Rusya&#39;yı y&uuml;zde 5 artış ve 215 milyon dolarlık gelirle Almanya&#39;nın &nbsp;izlediğini kaydeden Sin, 2019&rsquo;da en dikkati &ccedil;eken ihracat artış oranının y&uuml;zde &nbsp;317 ile Hindistan&rsquo;da yaşandığını, bu &uuml;lkeye bir yılda toplam 37,5 milyon dolarlık &nbsp;yaş meyve sebze ihra&ccedil; ettiklerini bildirdi.</p>\r\n\r\n<p>Sin, Akdeniz İhracat&ccedil;ı Birliklerinin (AKİB) 2019 yılında 1 milyar 94 &nbsp;milyon dolarlık ihracat ger&ccedil;ekleştirdiğinin altını &ccedil;izdi.</p>\r\n\r\n<p>B&ouml;lgede en &ccedil;ok ihracat yapan illerin Mersin ve Hatay olduğunu ifade &nbsp;eden Sin, &quot;&Ccedil;ift&ccedil;ilerimizin &ouml;zenle yetiştirdiği yaş meyve sebze &uuml;r&uuml;nlerinin &nbsp;kalitesini d&uuml;nyaya g&ouml;stermek, sekt&ouml;r&uuml;m&uuml;z&uuml;n pazar payını artırmak ve global &nbsp;gelişmeleri takip etmek &uuml;zere AKİB olarak sekt&ouml;r&uuml;n &uuml;&ccedil; b&uuml;y&uuml;k k&uuml;resel fuarına milli &nbsp;katılım sağladık.&quot; değerlendirmesinde bulundu. Sin, 2020 yılında da sekt&ouml;rdeki politikaların belirlenmesi ve &nbsp;geliştirilmesi i&ccedil;in yoğun bir şekilde &ccedil;alışacaklarını belirtti.&nbsp;</p>\r\n', 'haberresim_1578320299.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'yas-meyve-ve-sebze-ihracati-2-milyar-260-milyon-dolara-ulasti', 'yaş, meyve, sebze, ihracat'),
(9, 'Trafiğe 607 bin 595 aracın kaydı yapıldı', '<p>T&uuml;rkiye İstatistik Kurumu (T&Uuml;İK), kasım ayına ilişkin motorlu kara taşıtları istatistiklerini a&ccedil;ıkladı.<br />\r\n<br />\r\nBuna g&ouml;re, kasım sonu itibarıyla trafiğe kayıtlı toplam taşıt sayısı,&nbsp; ge&ccedil;en yılın aynı d&ouml;nemine g&ouml;re y&uuml;zde 1,4 artarak 22 milyon 850 bin 238&#39;den 23&nbsp; milyon 170 bin 769&#39;a y&uuml;kseldi. Bu ara&ccedil;ların y&uuml;zde 54&#39;&uuml;n&uuml; otomobil, y&uuml;zde 16,4&#39;&uuml;n&uuml;&nbsp; kamyonet, y&uuml;zde 14,4&#39;&uuml;n&uuml; motosiklet, y&uuml;zde 8,2&#39;sini trakt&ouml;r, y&uuml;zde 3,7&#39;sini&nbsp; kamyon, y&uuml;zde 2,1&#39;ini minib&uuml;s, y&uuml;zde 0,9&#39;unu otob&uuml;s, y&uuml;zde 0,3&#39;&uuml;n&uuml; ise &ouml;zel ama&ccedil;lı taşıtlar oluşturdu.<br />\r\n<br />\r\nKasımda trafiğe kaydı yapılan toplam taşıt sayısı 67 bin 126 oldu. Bu&nbsp; taşıtların i&ccedil;inde otomobil y&uuml;zde 65,5 ile ilk sırada yer aldı. Bunu sırasıyla&nbsp; y&uuml;zde 14,3 ile motosiklet, y&uuml;zde 12 ile kamyonet, y&uuml;zde 5 ile trakt&ouml;r takip etti.&nbsp; Taşıtların y&uuml;zde 1,5&#39;ini kamyon, y&uuml;zde 1&#39;ini minib&uuml;s, y&uuml;zde 0,6&#39;sını otob&uuml;s ve&nbsp; y&uuml;zde 0,1&#39;ini &ouml;zel ama&ccedil;lı taşıtlardan oluşturdu.<br />\r\n<br />\r\nTrafiğe kaydı yapılan taşıt sayısı kasımda bir &ouml;nceki aya g&ouml;re y&uuml;zde&nbsp; 1,4 azaldı. Bu d&uuml;ş&uuml;ş motosiklette y&uuml;zde 20,1, otob&uuml;ste y&uuml;zde 0,3 olurken, &ouml;zel&nbsp; ama&ccedil;lı taşıtlarda y&uuml;zde 141, kamyonette y&uuml;zde 8,1, trakt&ouml;rde y&uuml;zde 5,6, minib&uuml;ste&nbsp; ve kamyonda y&uuml;zde 2,4, otomobilde y&uuml;zde 1,4 arttı.<br />\r\n<br />\r\nS&ouml;z konusu ayda, ge&ccedil;en yılın d&ouml;nemine g&ouml;re trafiğe kaydı yapılan taşıt&nbsp; sayısında y&uuml;zde 0,8 artış ger&ccedil;ekleşti. Bu artış kamyonda y&uuml;zde 61,4, motosiklette&nbsp; y&uuml;zde 42,3, minib&uuml;ste y&uuml;zde 21,7, &ouml;zel ama&ccedil;lı taşıtlarda y&uuml;zde 11,9, otob&uuml;ste&nbsp; y&uuml;zde 1,3 olurken, kamyonette y&uuml;zde 17,6, trakt&ouml;rde y&uuml;zde 10,8, otomobilde y&uuml;zde&nbsp; 1,5 d&uuml;şt&uuml;.<br />\r\n<br />\r\nOcak-kasım d&ouml;neminde bir &ouml;nceki yılın aynı d&ouml;nemine g&ouml;re trafiğe kaydı&nbsp; yapılan taşıt sayısı y&uuml;zde 28,3 azalarak 607 bin 595, trafikten kaydı silinen&nbsp; taşıt sayısı y&uuml;zde 42,9 artarak 308 bin 470 oldu. B&ouml;ylece 2019 yılı Ocak-Kasım&nbsp; d&ouml;neminde trafiğe kayıtlı taşıt sayısı 299 bin 125 arttı.<br />\r\n<br />\r\n<strong>DEVRİ YAPILAN ARA&Ccedil;LAR</strong><br />\r\n<br />\r\nKasımda devri yapılan toplam 921 bin 379 taşıt i&ccedil;inde otomobil y&uuml;zde&nbsp; 73,7 ile ilk sırada yer aldı. Otomobili sırasıyla y&uuml;zde 15,6 ile kamyonet, y&uuml;zde&nbsp; 3,5 ile motosiklet, y&uuml;zde 3 ile trakt&ouml;r takip etti.<br />\r\n<br />\r\nTrafiğe kaydı yapılan otomobillerin y&uuml;zde 11,2&#39;si Fiat, y&uuml;zde 10,1&#39;i&nbsp; Volkswagen, y&uuml;zde 9,3&#39;&uuml; Renault, y&uuml;zde 7,5&#39;i Peugeot, y&uuml;zde 6,7&#39;si Hyundai, y&uuml;zde&nbsp; 6,2&#39;si Ford, y&uuml;zde 6,1&#39;i Opel, y&uuml;zde 5,4&#39;&uuml; Honda, y&uuml;zde 5,2&#39;si Skoda, y&uuml;zde 5,1&#39;i&nbsp; Toyota ve y&uuml;zde 27,2&#39;si diğer markalardan oluştu.<br />\r\n<br />\r\nS&ouml;z konusu ay sonu itibarıyla ocak-kasım d&ouml;neminde trafiğe kaydı&nbsp; yapılan 344 bin 971 adet otomobilin y&uuml;zde 55,3&#39;&uuml; dizel, y&uuml;zde 35,3&#39;&uuml; benzin,&nbsp; y&uuml;zde 5,9&#39;u LPG yakıtlı olup, y&uuml;zde 3,5&#39;i elektrikli veya hibrit ara&ccedil;lardan&nbsp; oluştu. Kasım ayı sonu itibarıyla trafiğe kayıtlı 12 milyon 519 bin 508&nbsp; otomobilin ise y&uuml;zde 38&#39;i dizel, y&uuml;zde 37,4&#39;&uuml; LPG, y&uuml;zde 24,2&#39;si benzin yakıtlı&nbsp; olup, y&uuml;zde 0,1&#39;inin elektrikli veya hibrit olduğu g&ouml;r&uuml;ld&uuml;. Yakıt t&uuml;r&uuml; bilinmeyen&nbsp; otomobillerin oranı y&uuml;zde 0,3 oldu.<br />\r\n<br />\r\nOcak-kasım d&ouml;neminde en fazla 1501-1600 silindir hacimli otomobil&nbsp; kaydı yapılırken, trafiğe kaydı yapılan otomobillerin y&uuml;zde 37,6&#39;sının 1501-1600,&nbsp; y&uuml;zde 28,5&#39;inin 1401-1500, y&uuml;zde 13,5&#39;inin 1301-1400, y&uuml;zde 13,1&#39;inin 1300 ve&nbsp; altı, y&uuml;zde 6,2&#39;sinin 1601-2000, y&uuml;zde 1,1&#39;inin 2001 ve &uuml;st&uuml; motor silindir&nbsp; hacmine sahip olduğu belirlendi.<br />\r\n<br />\r\nOcak-kasım d&ouml;neminde kaydı yapılan otomobillerin y&uuml;zde 53,9&#39;unun&nbsp; beyaz, y&uuml;zde 24,1&#39;inin gri, y&uuml;zde 6,8&#39;inin siyah ve y&uuml;zde 5,7&#39;sinin kırmızı,&nbsp; y&uuml;zde 9,5&#39;inin diğer renkler olduğu g&ouml;r&uuml;ld&uuml;.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'haberresim_1578320373.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'trafige-607-bin-595-aracin-kaydi-yapildi', 'Trafiğe, 607, bin, 595, aracın, kaydı, yapıldı'),
(11, 'S&P: Körfez bölgesinde riskler arttı', '<p>S&amp;P&#39;den yapılan a&ccedil;ıklamada, İran Devrim Muhafızları&#39;na bağlı Kud&uuml;s G&uuml;c&uuml; Komutanı Kasım S&uuml;leymani&#39;nin ABD tarafından &ouml;ld&uuml;r&uuml;lmesinin ardından yaşanan&nbsp; gelişmelerin K&ouml;rfez b&ouml;lgesinde riskleri arttırdığı belirtildi.<br />\r\n<br />\r\nA&ccedil;ıklamada, artan risklere rağmen S&amp;P&#39;nin halen b&ouml;lge i&ccedil;in temel senaryosunun &quot;ABD ve İran arasında tam kapsamlı askeri bir karşılaşmanın olmayacağı&quot; y&ouml;n&uuml;nde bulunduğu aktarıldı.<br />\r\n<br />\r\nK&ouml;rfez &uuml;lkelerine ilişkin &uuml;lke kredi derecelendirmelerinin mevcut&nbsp; b&ouml;lgesel oynaklıkları yansıttığı belirtilen a&ccedil;ıklamada, gerilimin artması durumunda y&uuml;kselen petrol fiyatlarından gelen gelirin petrol &uuml;reticisi &uuml;lkelerin olası sermaye &ccedil;ıkışının etkilerini telafi edebileceği kaydedildi.<br />\r\n<br />\r\nB&ouml;lgesel risklerin, gelecek d&ouml;nemde temel senaryodaki &ouml;ng&ouml;r&uuml;lerin &uuml;zerinde artış g&ouml;stermesi durumunda Abu Dabi, Kuveyt, Katar ve Suudi Arabistan&#39;ın dış varlık seviyeleri nedeniyle daha korunaklı olduğu belirtilen a&ccedil;ıklamada, olası sermaye &ccedil;ıkışlarına ilişkin Bahreyn ve Katar&#39;ın daha kırılgan olduğu bildirildi.</p>\r\n', 'haberresim_1578320453.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'sp-korfez-bolgesinde-riskler-artti', 'S&P, Körfez, bölgesinde, riskler, arttı'),
(12, 'Avrupa borsaları haftaya düşüşle başladı', '<p>A&ccedil;ılışın ardından Stoxx Europe 600 g&ouml;sterge endeksi y&uuml;zde 0,40 değer kaybederek 416,64 puan, Almanya&#39;da DAX 30 endeksi y&uuml;zde 1,10 azalarak 13.078,06&nbsp; puan oldu.<br />\r\n<br />\r\nİngiltere&#39;de FTSE 100 endeksi y&uuml;zde 0,43 d&uuml;ş&uuml;şle 7.580,20 puanda, İspanya&#39;da IBEX 35 endeksi y&uuml;zde 0,80 kayıpla 9.575,40 puanda, Fransa&#39;da CAC 40&nbsp; endeksi y&uuml;zde 0,70 azalışla 6.001,98 puanda, İtalya&#39;da MIB 30 endeksi ise y&uuml;zde&nbsp; 0,80 gerileyerek 23.521,16 puanda seyrediyor.<br />\r\n<br />\r\nAnalistler, ABD ile İran arasındaki gerilimin İran&#39;ın Devrim&nbsp; Muhafızları Kud&uuml;s G&uuml;c&uuml; Komutanı Kasım S&uuml;leymani&#39;nin ABD tarafından &ouml;ld&uuml;r&uuml;lmesi&nbsp; sonrası hızlı bir şekilde y&uuml;kseldiğini belirterek, taraflardan gelen&nbsp; a&ccedil;ıklamaların petrol fiyatlarında y&uuml;kselişe, g&uuml;venli liman olarak g&ouml;r&uuml;len enstr&uuml;manların y&uuml;kselmesine neden olduğunu ifade etti.<br />\r\n<br />\r\nBug&uuml;n,&nbsp;Euro&nbsp;B&ouml;lgesi&#39;nde hizmet sekt&ouml;r&uuml; PMI ve &Uuml;retici Fiyat Endeksi verileri takip edilecek.</p>\r\n', 'haberresim_1578320562.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'avrupa-borsalari-haftaya-dususle-basladi', 'Avrupa, borsaları, haftaya, düşüşle, başladı'),
(13, 'Euro Bölgesi`nde ÜFE yükseldi', '<p>Avrupa İstatistik Ofisi (Eurostat), Avrupa Birliği (AB) ve&nbsp;Euro&nbsp;B&ouml;lgesi&#39;nin kasım ayı &Uuml;retici Fiyat Endeksi (&Uuml;FE) verilerini yayımladı.<br />\r\n<br />\r\nBuna g&ouml;re, 19 &uuml;yeli Euro B&ouml;lgesi&#39;nde &Uuml;FE, kasımda ekim ayına kıyasla y&uuml;zde 0,2 arttı. &Uuml;FE, 2018&#39;in kasım ayına g&ouml;re ise y&uuml;zde 1,4 d&uuml;şt&uuml;.<br />\r\n<br />\r\nAB&#39;de &Uuml;FE, kasımda bir &ouml;nceki aya kıyasla y&uuml;zde 0,1 artarken, 2018&#39;in aynı d&ouml;nemine g&ouml;re y&uuml;zde 1 geriledi.<br />\r\n<br />\r\nAB &uuml;lkeleri arasında &Uuml;FE, kasımda &ouml;nceki aya kıyasla en fazla y&uuml;zde 3,4 ile Yunanistan, y&uuml;zde 1,1 ile Fransa ve y&uuml;zde 0,9 ile İsve&ccedil;&#39;te y&uuml;kseldi.<br />\r\n<br />\r\n&Uuml;FE&#39;de en fazla d&uuml;ş&uuml;ş ise y&uuml;zde 0,9 ile Portekiz, y&uuml;zde 0,6 ile&nbsp; İspanya ve y&uuml;zde 0,5 ile Letonya&#39;da &ouml;l&ccedil;&uuml;ld&uuml;.</p>\r\n', 'haberresim_1578320723.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'euro-bolgesinde-ufe-yukseldi', 'Euro, Bölgesi`nde, ÜFE, yükseldi'),
(14, 'Moody\'s, ABD-İran gerginliği hakkında uyarıda bulundu', '<p>Moody&#39;s Investor Service, ABD ile İran arasında giderek tırmanan gerginliklerin, k&uuml;resel ekonomide riskleri artırdığı uyarısı yaptı.</p>\r\n\r\n<p>Moody&#39;s&#39;in Pazartesi g&uuml;n&uuml; a&ccedil;ıkladığı raporda, Washington ve Tahran&#39;ın gerginliği &quot;askeri d&uuml;zeylere kadar tırmandırmayacağı&quot;na ilişkin &ouml;ng&ouml;r&uuml;leri korudukları vurgulansa da, bu durumun belirsizlikleri artırdığına ve bunun da &ouml;zellikle petrol ve doğalgaz end&uuml;trilerini olumsuz etkilediğine dikkat &ccedil;ekildi ve ş&ouml;yle denildi:</p>\r\n\r\n<p><br />\r\n&quot;Uzun s&uuml;recek bir anlaşmazlık durumu, ekonomik faaliyet ve finansal koşulları zorlaştıran şok etkisi yaratarak, geniş anlamda k&uuml;resel ekonomi &uuml;zerinde olumsuzluklara neden olabilir. Kritik altyapı &uuml;zerinde oluşacak hasarlar ve ticarette ge&ccedil;ici bozulma, finans dışı şirketleri olumsuz etkileyecektir.&quot;</p>\r\n\r\n<p>Raporda ayrıca, bu s&uuml;re&ccedil;ten &ouml;zellikle hidrokarbon bazlı end&uuml;strilerin olumsuz etkileneceğine dikkat &ccedil;ekildi.</p>\r\n\r\n<p>ABD ordusunun, İran Devrim Muhafızları Ordusu Kud&uuml;s G&uuml;c&uuml; Komutanı General Kasım S&uuml;leymani&rsquo;yi &ouml;ld&uuml;rmesi sonrası tırmanan gerilimler k&uuml;resel piyasaları olumsuz etkiliyor. İran&rsquo;ın misilleme saldırı a&ccedil;ıklaması kapsamında</p>\r\n\r\n<p>Pazar g&uuml;n&uuml; 2015 n&uuml;kleer anlaşması esaslarına uymayacağını duyurmasının ardından ABD Başkanı Trump ise İran&rsquo;ın saldırması durumunda ABD&rsquo;nin &ldquo;daha sert &ouml;nlemler&rdquo; alacağını s&ouml;yledi.</p>\r\n\r\n<p>S&ouml;z konusu jeopolitik g&ouml;r&uuml;n&uuml;m kapsamında Yıldırımt&uuml;rk, bu gelişmelerin ekonomik gelişmeler olmaması sebebiyle T&uuml;rkiye&rsquo;de altın fiyatlarında g&ouml;r&uuml;len oynamaların k&uuml;resel altın fiyatlarında g&ouml;r&uuml;len artışa paralel olarak ger&ccedil;ekleştiğini belirtirken, bu artışın hafta sonuna kadar devam edebileceğini, fakat 15 Ocak&rsquo;ta ABD ve &Ccedil;in arasında Beyaz Saray&rsquo;da imzalanacak olan ticaret anlaşması sonrası dengelenebileceğini &ouml;ng&ouml;rd&uuml;.</p>\r\n\r\n<p>ABD Başkanı Donald Trump, resmi Twitter hesabından yaptığı bir paylaşımda, iki &uuml;lkenin 15 Ocak&rsquo;ta ticaret anlaşmasının ilk kısmını imzalayacağını, gelecek d&ouml;nemde de ticaret anlaşmasının ikinci kısmına y&ouml;nelik m&uuml;zakereler i&ccedil;in Pekin&rsquo;e gideceğini duyurmuştu.</p>\r\n', 'gorsel.png', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-05 21:00:00', 'moodys-abd-iran-gerginligi-hakkinda-uyarida-bulundu', 'Moody\'s, ABD-İran, gerginliği, hakkında, uyarıda, bulundu'),
(17, 'Konut Kredilerinde Finasnman Değerler Düştü', '<p>Ziraat Katılım, sıfır konut alacaklara y&uuml;zde 0.79&#39;dan kredi kullandıracak. Kredi vadesi 120 ay olacak ve 500 bin liraya kadar kredi kullanılabilecek.<br />\r\nGe&ccedil;tiğimiz haftalarda Hazine ve Maliye Bakanı Berat Albayrak&#39;ın Şırnak&#39;ta a&ccedil;ıkladığı sıfır konutlardaki faiz indirimine ilişkin ilk adımı Ziraat Katılım attı.</p>\r\n\r\n<p>Ziraat Katılım, sıfır konutlarda finansman oranlarını 08.01.2020 tarihinden itibaren ge&ccedil;erli olmak &uuml;zere 0.79 olarak belirledi.</p>\r\n\r\n<p>Kredi 120 ay vade ile sınırlı olacak ve azami 500 bin lira kullandırılacak.&nbsp;</p>\r\n', 'haberresim_1578481502.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-07 21:00:00', 'konut-kredilerinde-finasnman-degerler-dustu', 'ziraat, kredi, konut, düştü'),
(18, 'Merkez Bankası yılın ilk beklenti anketi sonuçlarını paylaştı', '<p>T&uuml;rkiye Cumhuriyet Merkez Bankası (TCMB), 2020 yılı Ocak ayı Beklenti Anketi İstatistiklerini paylaştı. Anketin istatistiklerine g&ouml;re yıl sonu GSYH b&uuml;y&uuml;me beklentisi bir &ouml;nceki anket d&ouml;neminde y&uuml;zde 3,2 iken, bu anket d&ouml;neminde y&uuml;zde 3,4 oldu. 2021 yılı b&uuml;y&uuml;me beklentisi ise bu anket d&ouml;neminde y&uuml;zde 3,7 olarak ger&ccedil;ekleşti. İşte Merkez Bankası&#39;nın 2020 yılı Ocak ayı Beklenti Anketi İstatistikleri!<br />\r\nT&uuml;rkiye Cumhuriyet Merkez Bankası (TCMB), 2020 yılı Ocak ayı Beklenti Anketi İstatistiklerini paylaştı. 2020 yılı Ocak ayı Beklenti Anketi, reel sekt&ouml;r ve finansal sekt&ouml;r temsilcileri ile profesyonellerden oluşan 62 katılımcı tarafından yanıtlandı ve sonu&ccedil;lar katılımcıların yanıtları toplulaştırılarak değerlendirildi.</p>\r\n\r\n<p><strong>YILLIK ENFLASYON BEKLENTİLERİ</strong></p>\r\n\r\n<p>2020 yıl sonu t&uuml;ketici enflasyonu (T&Uuml;FE) beklentisi bu anket d&ouml;neminde y&uuml;zde 10,01 oldu. 12 ay sonrası T&Uuml;FE beklentisi bir &ouml;nceki anket d&ouml;neminde y&uuml;zde 10,07 iken, bu anket d&ouml;neminde y&uuml;zde 9,54 oldu. 24 ay sonrası T&Uuml;FE beklentisi ise aynı anket d&ouml;nemlerinde sırasıyla y&uuml;zde 8,94 ve y&uuml;zde 8,51 olarak ger&ccedil;ekleşti.</p>\r\n\r\n<p><strong>12 AY SONRASI ENFLASYON BEKLENTİLERİ</strong></p>\r\n\r\n<p>2020 yılı Ocak ayı anket d&ouml;neminde, katılımcıların 12 ay sonrasına ilişkin olasılık tahminleri değerlendirildiğinde, T&Uuml;FE&#39;nin ortalama olarak y&uuml;zde 16,0 olasılıkla y&uuml;zde 8,00 8,99 aralığında y&uuml;zde 41,4 olasılıkla y&uuml;zde 9,00 9,99 aralığında, y&uuml;zde 27,0 olasılıkla ise y&uuml;zde 10,00-10,99 aralığında artış g&ouml;stereceği &ouml;ng&ouml;r&uuml;l&uuml;yor.</p>\r\n\r\n<p>Aynı anket d&ouml;neminde nokta tahminler esas alınarak yapılan değerlendirmeye g&ouml;re ise, katılımcıların y&uuml;zde 13,7&#39;sinin beklentilerinin y&uuml;zde 8,00 8,99 aralığında, y&uuml;zde 58,8&#39;inin beklentilerinin y&uuml;zde 9,00 9,99 aralığında, y&uuml;zde 17,6&#39;sının beklentilerinin ise y&uuml;zde 10,00 10,99 aralığında olduğu g&ouml;zlendi.</p>\r\n\r\n<p><strong>24 AY SONRASI ENFLASYON BEKLENTİLERİ</strong></p>\r\n\r\n<p>2020 yılı Ocak ayı anket d&ouml;neminde, katılımcıların 24 ay sonrasına ilişkin olasılık tahminleri değerlendirildiğinde, T&Uuml;FE&#39;nin ortalama olarak y&uuml;zde 19,1 olasılıkla y&uuml;zde 7,00 7,99 aralığında, y&uuml;zde 41,5 olasılıkla y&uuml;zde 8,00 8,99 aralığında, y&uuml;zde 21,5 olasılıkla ise y&uuml;zde 9,00 9,99 aralığında artış g&ouml;stereceği &ouml;ng&ouml;r&uuml;l&uuml;yor.</p>\r\n\r\n<p>Aynı anket d&ouml;neminde nokta tahminler esas alınarak yapılan değerlendirmeye g&ouml;re, 24 ay sonrası T&Uuml;FE enflasyonu beklentileri değerlendirildiğinde, katılımcıların y&uuml;zde 19,6&#39;sının beklentilerinin y&uuml;zde 7,00 7,99 aralığında, y&uuml;zde 45,7&#39;sinin beklentilerinin y&uuml;zde 8,00 8,99 aralığında, y&uuml;zde 17,4&#39;&uuml;n&uuml;n beklentilerinin ise y&uuml;zde 9,00 9,99 aralığında olduğu g&ouml;zlendi.</p>\r\n\r\n<p><strong>FAİZ BEKLENTİLERİ</strong></p>\r\n\r\n<p>BİST Repo ve TersRepo Pazarı&#39;nda oluşan cari ay sonu gecelik faiz oranı beklentisi bir &ouml;nceki anket d&ouml;neminde y&uuml;zde 12,40 iken, bu anket d&ouml;neminde y&uuml;zde 11,43&#39;e geriledi.. TCMB Ağırlıklı Ortalama Fonlama Maliyeti cari ay sonu beklentisi bir &ouml;nceki anket d&ouml;neminde y&uuml;zde 12,41 iken bu anket d&ouml;neminde y&uuml;zde 11,31 oldu. TCMB bir hafta vadeli repo ihale faiz oranı cari ay sonu beklentisi ise aynı anket d&ouml;nemlerinde sırasıyla y&uuml;zde 12,52 ve y&uuml;zde 11,53 olarak ger&ccedil;ekleşmişti.</p>\r\n\r\n<p>Vadesine beş yıl ya da beş yıla yakın s&uuml;re kalan DİBS&#39;lerin 12 ay sonrası ikincil piyasa yıllık bileşik faiz oranı beklentisi bir &ouml;nceki anket d&ouml;neminde y&uuml;zde 11,11 iken, bu anket d&ouml;neminde y&uuml;zde 10,75 oldu. Vadesine on yıl ya da on yıla yakın s&uuml;re kalan DİBS&#39;lerin 12 ay sonrası ikincil piyasa yıllık bileşik faiz oranı beklentisi ise aynı anket d&ouml;nemlerinde sırasıyla y&uuml;zde 11,17 ve y&uuml;zde 10,77 olarak ger&ccedil;ekleşti.</p>\r\n\r\n<p><strong>D&Ouml;VİZ KURU BEKLENTİLER</strong></p>\r\n\r\n<p>2020 yıl sonu d&ouml;viz kuru (ABD Doları/TL) beklentisi bu anket d&ouml;neminde 6,41 TL oldu. 12 ay sonrası d&ouml;viz kuru beklentisi ise bir &ouml;nceki anket d&ouml;neminde 6,35 TL iken, bu anket d&ouml;neminde 6,43 TL olarak ger&ccedil;ekleşti.</p>\r\n\r\n<p><strong>GSYH B&Uuml;Y&Uuml;ME BEKLENTİLERİ</strong></p>\r\n\r\n<p>GSYH 2020 yılı b&uuml;y&uuml;me beklentisi bir &ouml;nceki anket d&ouml;neminde y&uuml;zde 3,2 iken, bu anket d&ouml;neminde y&uuml;zde 3,4 oldu. 2021 yılı b&uuml;y&uuml;me beklentisi ise bu anket d&ouml;neminde y&uuml;zde 3,7 olarak ger&ccedil;ekleşti.</p>\r\n', 'haberresim_1578731454.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-10 21:00:00', 'merkez-bankasi-yilin-ilk-beklenti-anketi-sonuclarini-paylasti', ' merkez, bankası'),
(19, 'Dolar önemli paralar karşısında fazla değişmedi', '<p>Bloomberg Dolar Spot Endeksi (BBDXY), maj&ouml;r paralar g&ouml;rece dar bantlar i&ccedil;erisinde seyrederken fazla değişmedi.</p>\r\n\r\n<p>Dolar G &ndash; 10 paraları karşısında karışık bir seyir izlerken, g&uuml;venli paralar &Ccedil;in verisinin beklentileri aşmasının ardından geriledi. Dolar/yen paritesi y&uuml;zde 0.1 y&uuml;kselerek 110.29 ile 23 Mayıs&#39;tan bu yana en y&uuml;ksek seviyeyi g&ouml;rd&uuml;.</p>\r\n\r\n<p>Yenin d&uuml;ş&uuml;ş&uuml;, beklenti aralığının zayıf sınırında bulunmasından dolayı Japon hayat sigortası şirketleri i&ccedil;in bir sorun oluşturmaya başladı.</p>\r\n\r\n<p>Euro/Dolar paritesi 1.1135&#39;te fazla değişmedi. Sterlin/dolar paritesi hafif y&uuml;kselişle 1.3090&#39;dan işlem g&ouml;rd&uuml;.</p>\r\n', 'haberresim_1579260705.jpg', 'Zülfü Mehmet ÖZÇİFÇİ', '2020-01-16 21:00:00', 'dolar-onemli-paralar-karsisinda-fazla-degismedi', 'Dolar, önemli, paralar, karşısında, fazla, değişmedi,');
